import { StyleSheet } from "react-native";

const styles=StyleSheet.create({
    eyeContainer:{
        width:'100%',
        height:'100%',
    
      },
    
      titles: {
        marginTop: '30%',
        width:'100%',
        alignItems: 'center',
      },
    
      title: {
        fontSize: 35,
        fontWeight:'500',
      },

});

export default styles;
